import React, { useEffect } from 'react';
import './Menu.css';
import data from '../../../mock-data.json';

function Menu() {
  let categories = [];
  for(let obj of data) {
    if(categories.indexOf(obj.category) == -1) categories.push(obj.category);
  }

  return (
    <ul>
        {categories.map((item, index) => <li key={index}>{item}</li>)}
    </ul>
  );
}

export default Menu;
